caption:
This is the tutorial for when you get back from the Valentine’s Day date & you KNOW what’s coming… 
👁️🫦👁️ 
It’s catfishing, but not. 
It’s you, but at your best. 
It’s your beauty… but enhanced! 
The ULTIMATE look for horizontal evenings with your other half, or date night sleepovers with a new bf, netflix & chill sessions with a booty call/friends with benefit bookings or whatever y’all are calling it these days. Just made sure you’re showered & shaved before starting this routine ☑️

This is a ’no makeup’ look (basically) that guarantees you wake up looking like an angel - no chance of smudged mascara or embarrassing foundation smears on the pillow 😇

